The How It Works Annual 2013 is the ultimate collection of fantastic articles from How It Works magazine. Helping to explain how things work, this book is perfect for every age, whether you're looking to increase your knowledge on a specific subject, research a school project or just find out some fun facts.

With sections covering space, science, technology, transport, the environment and history, there's something for everyone. So whether you want to know how all the latest gadgets work, how humans survive in space, what's involved in the aging process or how penguins survive in such cold conditions, this is the only book for you.
